  KEY `orderid_3` (`orderid`,`huobi`),
  KEY `atime` (`atime`),
  KEY `cpid_2` (`cpid`,`pingoff`),
  KEY `cpid_3` (`cpid`,`miaosufen`,`pingoff`),
  KEY `miaosufen` (`miaosufen`),
  KEY `id` (`id`),
  KEY `pingoff` (`pingoff`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

